angular.module("momentum.actions").run(["$templateCache",function($templateCache){$templateCache.put("/directives/petition.feed.html",'<div data-ng-repeat="a in Feed.actions | orderBy:\'-createdAt\'" class="actionItem"><p><b>{{ a.first_name }} said</b> {{ a.message}}<small class="clearfix">at {{ a.createdAt | date : \'medium\' }}</small></p></div>'),$templateCache.put("/directives/petition.form.html",'<form id="actionForm" data-ng-submit="Form.create()"><div class="form-group"><input type="text" data-ng-model="Form.newAction.first_name" data-ng-required="true" placeholder="First Name" class="form-control"/></div><div class="form-group"><textarea data-ng-model="Form.newAction.message" data-ng-required="true" placeholder="Message" class="form-control"></textarea></div><button class="btn btn-success btn-block btn-lg">Sign Action</button></form>')}]);